package net.linxingyang.diary.qo;import java.util.Date;import net.linxingyang.diary.pojo.Diary;public class DiaryQo extends Diary{	private Integer page;	private Integer limit;	private Date minDiaryDate;	private Date maxDiaryDate;	private String orderBy;		public String getOrderBy() {		return orderBy;	}	public void setOrderBy(String orderBy) {		this.orderBy = orderBy;	}	public Date getMinDiaryDate() {		return minDiaryDate;	}	public void setMinDiaryDate(Date minDiaryDate) {		this.minDiaryDate = minDiaryDate;	}	public Date getMaxDiaryDate() {		return maxDiaryDate;	}	public void setMaxDiaryDate(Date maxDiaryDate) {		this.maxDiaryDate = maxDiaryDate;	}	public void setPage(Integer page) {	    this.page = page;	} 		public Integer getPage() {	    return this.page;	}		public void setLimit(Integer limit) {	    this.limit = limit;	}		public Integer getLimit() {	    return this.limit;    	}    }